import React, {Component} from 'react';
import "./login.css";
import user_img from "./user.png";
import pwd_img from "./pwd.png";

class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {username: '', password: ''};

    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleChange(event) {
    this.setState({username: event.target.username, password: event.target.password});
  }

  handleSubmit(event) {
    alert('A name was submitted: ' + this.state.username);
    event.preventDefault();
  }

  render() {
    return (
      <div className="login-bng">
        <div className="login-board">
          <div className="login-wrapper">
          <h2 className="formHeader">Welcome</h2>
          <form onSubmit={this.handleSubmit}>
              <div class = 'input_div user'>
                <img className = 'input_icon' src = {user_img}/>
                <input type = 'text' className="form_input" value={this.state.username} onChange={this.handleChange} />
              </div>
              <div class ='input_div pwd'>
                <img className = 'input_icon' src = {pwd_img}/>
                <input type = 'password' className="form_input" value={this.state.password} onChange={this.handleChange} />
              </div>
              <input type="submit" value="Submit" />
          </form>
          </div>
        </div>
      </div>
    );
  }
}

export default Login;
